import React from "react";
import styled from 'styled-components';

const AppAggroCardContainer = styled.div`
    width: 500px;
    height: 300px;
    background-color: var(--main-color);
    color: white;
`;

export default function AppAggroCard({text}) {
    return (
        <AppAggroCardContainer>
            {text}
            ddd
        </AppAggroCardContainer>
    );
}
